    const cate = array.map((arrays) => 
        (<label id='cate'>
            <input type="checkbox" name="category" value={arrays} />
                {arrays}
            </label>))
    
    return(
        <div>
            <p className='t'>▼</p>
            {cate}
        </div>
    );
}

